'Blog A' => 'Блог А',
"<p>This blog platform is powered by b2evolution.</p>\n\n<p>You are currently looking at an info page about this system. It is cross-posted among the demo blogs. Thus, this page will be linked on each of these blogs.</p>\n\n<p>Info pages are very much like regular posts, except that they do not appear in the regular flow of posts. They appear as info pages in the sidebar instead.</p>\n\n<p>If needed, an evoskin can format info pages differently from regular posts.</p>" => "<p>Эти блоги работают на b2evolution.</p>\n\n<p>В настоящее время вы просматриваете информационную страницу об этой системе. Она одновременно размещена среди всех демонстрационных блогов. Таким образом, эта страница будет видна на всех этих блогах.</p>\n\n<p>Информационные страницы являются обычными записи, за исключением того что они не появляются в обычном потоке записей. Они появляются как информационные страницы в боковой панели.</p>\n\n<p>Если это необходимо, то тема может располагать информационные страницы не так как обычные записи.</p>",
'Main Intro post' => 'Главная интро запись',
'This is the main intro post. It appears on the homepage only.' => 'Главная интро запись. Она показывается только на главной странице блога.',
'This uses post type "Intro-Cat" and is attached to the desired Category(ies).' => 'Эта запись типа "Intro-Cat", она прикрепляется к необходимым Рубрикам.',
'b2evolution tips category &ndash; Sub Intro post' => 'Категория "советы по b2evolution" &ndash; это Sub Intro запись',
'This uses post type "Intro-Tag" and is tagged with the desired Tag(s).' => 'Эта запись типа "Intro-Tag", она связана необходимыми Тегами.',
"<p>This is a demo of a featured post.</p>\n\n<p>It will be featured whenever we have no specific \"Intro\" post to display for the current request. To see it in action, try displaying the \"Announcements\" category.</p>\n\n<p>Also note that when the post is featured, it does not appear in the regular post flow.</p>" => "<p>Это пример избранной записи.</p>\n\n<p>Она будет выводиться первой в случаях, когда не задана специальная \"Интро\" запись для текущего запроса.</p>\n\n<p>Заметьте, если запись является избранной, она не появляется в Основном потоке записей.</p>",
"<p>In the <code>/blogs</code> folder there is a file called [<code>sample.htaccess</code>]. You should try renaming it to [<code>.htaccess</code>].</p>\n\n<p>This will optimize the way b2evolution is handled by the webserver (if you are using Apache). This file is not active by default because a few hosts would display an error right away when you try to use it. If this happens to you when you rename the file, just remove it and you'll be fine.</p>" => "<p>В папке <code>/blogs</code> есть файл с названием [<code>sample.htaccess</code>]. Вам следует переименовать его в [<code>.htaccess</code>].</p>\n\n<p>Это позволит оптимизировать работу b2evolution на веб сервере (если вы используете Apache). Этот файл не активирован по умолчанию, поскольку на некоторых хостингах он может вызвать ошибки сразу после его активирования. Если это происходит и в вашем случае, просто удалите этот файл</p>",
'Apache optimization...' => 'Оптимизация Apache...',
"<p>By default, blogs are displayed using an evoskin. (More on skins in another post.)</p>\n\n<p>This means, blogs are accessed through '<code>index.php</code>', which loads default parameters from the database and then passes on the display job to a skin.</p>\n\n<p>Alternatively, if you don't want to use the default DB parameters and want to, say, force a skin, a category or a specific linkblog, you can create a stub file like the provided '<code>a_stub.php</code>' and call your blog through this stub instead of index.php .</p>\n\n<p>Finally, if you need to do some very specific customizations to your blog, you may use plain templates instead of skins. In this case, call your blog through a full template, like the provided '<code>a_noskin.php</code>'.</p>\n\n<p>If you want to integrate a b2evolution blog into a complex website, you'll probably want to do it by copy/pasting code from <code>a_noskin.php</code> into a page of your website.</p>\n\n<p>You will find more information in the stub/template files themselves. Open them in a text editor and read the comments in there.</p>\n\n<p>Either way, make sure you go to the blogs admin and set the correct access method/URL for your blog. Otherwise, the permalinks will not function properly.</p>" => "<p>По умолчанию, блоги отображаются используя evoskin т.е. тему. Подробнее об использовании тем вы сможете прочесть в другой записи.</p>\n\n<p>Это означает что блоги вызываются через файл '<code>index.php</code>', который загружает исходные параметры из базы данных и затем \"показывает\" их через файлы темы.</p>\n\n<p>В случае, когда вы не хотите использовать параметры по умолчанию и хотите, скажем, вызвать тему, рубрику или определенный блог, вы можете создать файл-заглушку (stub file) как, например, '<code>a_stub.php</code>' и вызывать ваш блог через эту заглушку вместо index.php .</p>\n\n<p>И наконец, если вы хотите выполнить тонкую настройку вашего блога, вы можете использовать простые шаблоны вместо тем. В таком случае вы вызываете ваш блог через полный шаблон, как, например '<code>a_noskin.php</code>'.</p>\n\n<p>Если вы хотите интегрировать отдельный блог b2evolution в уже имеющийся сайт, вы, возможно, захотите сделать это путем вставки отдельных блоков кода из <code>a_noskin.php</code> в страницу вашего веб сайта.</p>\n\n<p>Дополнительную имформацию вы найдете непосредственно в файлах-заглушках и шаблонах. Откройте их в текстовом редакторе и прочитайте комментарии.</p>\n\n<p>В любом случае, убедитесь что вы установили корректный способ вызова (URL) ваших блогов в панели управления. В противном случае, постоянные ссылки не будут работать корректно.</p>",
'Skins, Stubs, Templates &amp; website integration...' => 'Темы, Заглушки, Шаблоны и интеграция сайта...',
"<p>b2evolution blogs are installed with a default selection of Widgets. For example, the sidebar of this blog includes widgets like a calendar, a search field, a list of categories, a list of XML feeds, etc.</p>\n\n<p>You can add, remove and reorder widgets from the Blog Settings tab in the admin interface.</p>\n\n<p>Note: to be displayed widgets are placed in containers. Each container appears in a specific place in an evoskin. If you change your blog skin, the new skin may not use the same containers as the previous one. Make sure you place your widgets in containers that exist in the specific skin you are using.</p>" => "<p>Блоги b2evolution установлены с набором виджетов по умолчанию. Например, боковая панель этого блога включает такие виджеты как календарь, поле поиска, список рубрик, список лент XML, и т.д.</p>\n\n<p>Вы можете добавить, удалить или пересортировать виджеты из вкладки Настройки Блога в административном интерфейсе.</p>\n\n<p>Примечание: чтобы отображаться, виджеты помещаются в контейнеры. Каждый контейнер находится в определенном месте в теме. Если вы смените тему вашего блога, новая тема, возможно, не будет использовать те же контейнеры что и старая. Убедитесь что вы помещаете ваши виджеты в контейнеры, которые существуют в теме, которую вы используете.</p>",
'About widgets...' => 'О виджетах...',
"<p>By default, b2evolution blogs are displayed using an evoskin.</p>\n\n<p>You can change the skin used by any blog by editing the blog settings in the admin interface.</p>\n\n<p>You can download additional skins from the <a href=\"http://skins.b2evolution.net/\" target=\"_blank\">skin site</a>. To install them, unzip them in the /blogs/skins directory, then go to General Settings &gt; Skins in the admin interface and click on \"Install new\".</p>\n\n<p>You can also create your own skins by duplicating, renaming and customizing any existing skin folder from the /blogs/skins directory.</p>\n\n<p>To start customizing a skin, open its \"<code>index.main.php</code>\" file in an editor and read the comments in there. Note: you can also edit skins in the \"Files\" tab of the admin interface.</p>\n\n<p>And, of course, read the <a href=\"http://manual.b2evolution.net/Skins_2.0\" target=\"_blank\">manual on skins</a>!</p>" => "<p>По умолчанию, блоги b2evolution отображаются с помощью тем.</p>\n\n<p>Вы можете изменить тему, используемую блогом, редактируя настройки блога в административном интерфейсе.</p>\n\n<p>Вы можете загрузить дополнительные темы с <a href=\"http://skins.b2evolution.net/\" target=\"_blank\">сайта тем</a>. Для установки, распакуйте их в папку /blogs/skins, Затем перейдите в Глобальные настройки &gt; Установка темв в административном интерфейсе и щелкните \"Установить новую\".</p>\n\n<p>Вы также можете создать ваши собственные темы путем копирования, переименования и настраивания существующей папки темы в папке /blogs/skins.</p>\n\n<p>Чтобы приступить к настройке темы, откройте этот файл \"<code>index.main.php</code>\" в редакторе и прочтите комментарии в нем. И, конечно, прочтите <a href=\"http://manual.b2evolution.net/Skins_2.0\" target=\"_blank\">руководство</a>!</p>",
'About skins...' => 'О темах...',
"<p>This post has an image attached to it. The image is automatically resized to fit the current blog skin. You can zoom in by clicking on the thumbnail.</p>\n\n<p>Check out the photoblog (accessible through the links at the top) to see a completely different skin focused more on the photos than on the blog text.</p>" => "<p>К этой записи прикреплено изображение. Его размер автоматически изменен под размеры темы. Вы можете увеличить изображение нажав на него.</p>\n\n<p>В фотоблоге (ссылка вверху страницы) используется тема, предназначенная специально для показа изображений.</p>",
'Image post' => 'Запись с изображениями',
"<p>This is page 1 of a multipage post.</p>\n\n<p>You can see the other pages by clicking on the links below the text.</p>\n\n<!--nextpage-->\n\n<p>This is page 2.</p>\n\n<!--nextpage-->\n\n<p>This is page 3.</p>\n\n<!--nextpage-->\n\n<p>This is page 4.</p>\n\n<p>It is the last page.</p>" => "<p>Это первая страница многостраничной записи.</p>\n\n<p>Вы можете перемещаться между страницами, нажимая на ссылки внизу.</p>\n\n<!--nextpage-->\n\n<p>Страница 2.</p>\n\n<!--nextpage-->\n\n<p>Страница 3.</p>\n\n<!--nextpage-->\n\n<p>Страница 4.</p>\n\n<p>Последняя страница записи.</p>",
'This is a multipage post' => 'Многостраничная запись',
"<p>This is an extended post with no teaser. This means that you won't see this teaser any more when you click the \"more\" link.</p>\n\n<!--more--><!--noteaser-->\n\n<p>This is the extended text. You only see it when you have clicked the \"more\" link.</p>" => "<p>Расширенная запись без тизера. Это означает что вы не увидите этот текст при нажатии на ссылку \"Читать далее\".</p>\n\n<!--more--><!--noteaser-->\n\n<p>Продолжение записи. Вы можете прочитать это только после перехода по ссылке \"Читать далее\".</p>",
'Extended post with no teaser' => 'Расширенная запись без тизера',
"<p>This is an extended post. This means you only see this small teaser by default and you must click on the link below to see more.</p>\n\n<!--more-->\n\n<p>This is the extended text. You only see it when you have clicked the \"more\" link.</p>" => "<p>Расширенная запись. Вы видите только этот маленький тизер (вступление, предисловие) и должны нажать на ссылку ниже для просмотра записи целиком.</p>\n\n<!--more-->\n\n<p>Продолжение записи. Вы можете прочитать это только после перехода по ссылке \"Читать далее\".</p>",
'Extended post' => 'Расширенная запись',
"<p>Four blogs have been created with sample contents:</p>\n\n<ul>\n\t<li><strong>Blog A</strong>: You are currently looking at it. It contains a few sample posts, using simple features of b2evolution.</li>\n\t<li><strong>Blog B</strong>: You can access it from a link at the top of the page. It contains information about more advanced features.</li>\n\t<li><strong>Linkblog</strong>: By default, the linkblog is included as a \"Blogroll\" in the sidebar of both Blog A &amp; Blog B.</li>\n\t<li><strong>Photoblog</strong>: This blog is an example of how you can use b2evolution to showcase photos, with one photo per page as well as a thumbnail index.</li>\n</ul>\n\n<p>You can add new blogs, delete unwanted blogs and customize existing blogs (title, sidebar, blog skin, widgets, etc.) from the Blog Settings tab in the admin interface.</p>" => "<p>Было создано четыре блога со демонстрационными записями:</p>\n<ul>\n\t<li><strong>Блог A</strong>: Вы его видите прямо сейчас. Он содержит несколько записей, рассказывающих об основных возможностях b2evolution.</li>\n\t<li><strong>Блог B</strong>: Вы можете перейти к нему по ссылке вверху страницы. Он содержит информацию о дополнительных возможностях системы.</li>\n\t<li><strong>Блог ссылок</strong>: По умолчанию блог ссылок включен в боковую панель обоих блогов: Блог A и Блог B.</li>\n\t<li><strong>Фотоблог</strong>: Этот блог является примером использования b2evolution для создания фотоальбомов, как с одной картинкой на странице, так и с показом миниатюр со всех страниц блога.</li>\n</ul>\n\n<p>Вы можете добавить новые, удалить ненужные и настроить существующие блоги (заголовок, боковую панель, тему, виджеты и т.п.) из вкладки \"Настройки блога\" в панели управления.</p>",
'Welcome to b2evolution!' => 'Добро пожаловать в b2evolution!',
